                page.querySelector('#next-btn')?.addEventListener('click', () => { if (currentQIndex < validQuestions.length - 1) { currentQIndex++; renderQuestion(); }});
                page.querySelector('#finish-btn')?.addEventListener('click', () => { currentPage = 'results'; render(); });
